import { React, useState } from "react";
import img from "../../../images/svg-10.svg";
import { DataGrid, GridRowsProp, GridColDef } from "@material-ui/data-grid";

import {
  AddWrapper,
  AddText,
  AddImage,
  AddBtnWrapper,
  AddBtn,
  AddTxt,
} from "./AddElements";
import { AiFillFolderAdd } from "react-icons/ai";

const AddData = () => {
  const [file, setfile] = useState(false);
  const rows: GridRowsProp = [
    { id: 1, col1: "Hello", col2: "World" },
    { id: 2, col1: "XGrid", col2: "is Awesome" },
    { id: 3, col1: "Material-UI", col2: "is Amazing" },
  ];
  const columns: GridColDef[] = [
    { field: "col1", headerName: "Column 1", width: 150 },
    { field: "col2", headerName: "Column 2", width: 150 },
  ];

  return (
    <>
      {file ? (
        <AddWrapper>
          <AddBtnWrapper>
            <AddTxt>
              Upload a new dataset, or select one as your primary.
            </AddTxt>
            <AddBtn>
              Upload Data
              <AiFillFolderAdd></AiFillFolderAdd>
            </AddBtn>
          </AddBtnWrapper>
          <AddImage src={img} alt="noyet"></AddImage>
          <AddText>No data imported yet !</AddText>
        </AddWrapper>
      ) : (
        <AddWrapper>
          <AddBtnWrapper>
            <AddTxt>
              Upload a new dataset, or select one as your primary.
            </AddTxt>
            <AddBtn>
              Upload Data
              <AiFillFolderAdd size="20px"></AiFillFolderAdd>
            </AddBtn>
          </AddBtnWrapper>
          <div style={{ height: 300, width: "100%" }}></div>
          <DataGrid rows={rows} columns={columns} pageSize={5} />
        </AddWrapper>
      )}
    </>
  );
};

export default AddData;
